import React from 'react';
import './HeroSection.css';

const HeroSection = () => {
    return (
        <section className="hero-section">
            <img src="https://media-cdn.tripadvisor.com/media/photo-s/09/9d/66/83/faisal-masjid.jpg" alt="Islamabad" />
            <div className="hero-text">
                <h2>Welcome to Islamabad</h2>
                <p>Explore the serene capital of Pakistan, nestled in the foothills of the Himalayas.</p>
            </div>
        </section>
    );
};

export default HeroSection;
